import React, { useState } from 'react';
import Webcam from "react-webcam";
import axios from 'axios';
import {
  Box,
  Heading,
  FormControl,
  FormLabel,
  Input,
  Button,
  Center,
  Image,
  Select,
  HStack,
  ChakraProvider,
  Slider,
  SliderTrack,
  SliderFilledTrack,
  SliderThumb,
  VStack
} from '@chakra-ui/react';

function ImageUploader() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [userImage, setuserImage] = useState(null);
  const [responseImage, setResponseImage] = useState(null);
  const [selectedPrompt, setSelectedPrompt] = useState("None")
  ;const [showCamera, setShowCamera] = useState(false);
  const webcamRef = useRef(null);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    setSelectedFile(event.target.files[0]);
    setuserImage(URL.createObjectURL(event.target.files[0]));
    reader.readAsDataURL(file);
    reader.onloadend = () => {
      setImageSrc(reader.result);
      setShowCamera(false);
    };
  };

  const handleCaptureClick = () => {
    const imageSrc = webcamRef.current.getScreenshot();
    setImageSrc(imageSrc);
    setShowCamera(false);
  };

  const handleCameraClick = () => {
    setShowCamera(true);
  };

  const handleCancelClick = () => {
    setShowCamera(false);
  };

  const handlePromptChange = (event) => {
    setSelectedPrompt(event.target.value);
  }

  const handleSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append('file', selectedFile);
    formData.append('Prompt', selectedPrompt);

    try {
      const response = await axios.post('http://127.0.0.1:8000/upload-image/', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      console.log(response.data);
      setResponseImage(response.data)
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <ChakraProvider>
      <Box color="black" textAlign="center" py={3}>
        <Heading as="h1" size="xl" mb={4}>
          Draw My Face
        </Heading>
      </Box>
      <Box marginLeft={20} marginRight={20}>
        <Box  bg="orange" color="black" textAlign="center" py={10} borderRadius="md">
          <HStack marginLeft={40} spacing={420}>
            <form onSubmit={handleSubmit}>
              <FormControl>
                <FormLabel>Choose a file</FormLabel>
                <Input type="file" onChange={handleFileChange} bg="white"/>
              </FormControl>
              <FormControl mt={4}>
                <FormLabel>Select an Prompt</FormLabel>
                <Select value={selectedPrompt} onChange={handlePromptChange} bg="white">
                  <Prompt value="None">None</Prompt>
                  <Prompt value="Cartoon">Cartoon</Prompt>
                </Select>
              </FormControl>
              <Slider defaultValue={2} min={0} max={4} step={1}>
                <SliderTrack bg='red.100'>
                  <Box position='relative' right={10} />
                  <SliderFilledTrack bg='tomato' />
                </SliderTrack>
                <SliderThumb boxSize={6} />
              </Slider>
              <VStack mt={4} spacing={4}>
                {showCamera ? (
                  <>
                    <Webcam audio={false} ref={webcamRef} screenshotFormat="image/jpeg" width={512} height={512} />
                    <Box>
                      <Button onClick={handleCaptureClick}>Capture</Button>
                      <Button onClick={handleCancelClick}>Cancel</Button>
                    </Box>
                  </>
                ) : (
                  <>
                    <Image src={userImage} width={512} height={512} />
                    <Button onClick={handleCameraClick}>Open Camera</Button>
                  </>
                )}
              </VStack>
              <Button type="submit" mt={4}>
                Upload
              </Button>
            </form>
            <Box>
              {responseImage ? (
                <Center mt={4}>
                  <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                    <Image src={`data:image/png;base64,${responseImage}`} w="100%" h="100%" objectFit="cover" />
                  </Box>
                </Center>
              ) : (
                <Center mt={4}>
                  <Box w={512} h={512} borderWidth="1px" borderColor="gray.200">
                    <Image src="https://via.placeholder.com/512x512.png?text=Placeholder" w="100%" h="100%" objectFit="cover" />
                  </Box>
                </Center>
            )}
            </Box>
          </HStack>
        </Box>
      </Box>
    </ChakraProvider>
  );
}

export default ImageUploader;
